import React,{useEffect,useState} from 'react'
import './estilosComponentes/restaurante.css'
import axios  from 'axios'
const Restaurantes = () => {
  const [restaurantes,setrestaurantes]=useState([])
  async function peticionRestaurantes(){
      const peticion=await axios.get("http://192.168.1.6:8080/menus");
      setrestaurantes(peticion);
      console.log(peticion)
  }
  useEffect(()=>{
    peticionRestaurantes
  },[]);
  
  return (
    <div className='restaurantes'>
      <header>
        <h1>Restaurantes</h1>
        <hr color='black'/>
        <div className='registroRestaurantes'></div>
      </header>
    </div> 
  )
}

export default Restaurantes
